gg = [23, 29, 32, 36, 38, 42, 44, 53, 57, 64]; % the list of the indices that carry the first 10 natural frequencies
nuu = 1;

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%% 
%%%%%%%%%%% THIS IS THE PLACE WHERE I TRY TO MAKE SURE THAT THE LENGTH 
%%%%%% OF THE SPACING VECTOR IS THE SAME 93 FOR BOTH THE NUMERICAL AND THE 
%%%%%%%%%%% EXPERIEMENTAL DATA %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
corresponding1 = load('corresponding1.mat');
corresponding1 = corresponding1.corresponding1;

grandpositions93 = load('grandpositions93.mat');
grandpositions93 = grandpositions93.grandpositions93;

jup = 1;
jmode_r = zeros(93,1);
for yu = 1:length(corresponding1)
    jmode_r(jup) = modeshape(corresponding1(yu),6);
    jup = jup + 1;
end


jup = 1;
jmode03_r = zeros(93,1);
for yu = 1:length(corresponding1)
    jmode03_r(jup) = modeshape03(corresponding1(yu),6);
    jup = jup + 1;
end

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
figure
b = plot(grandpositions93(:,1), (flip(Z_fen_group_CS1_Y_saved(gg(nuu),:)) + grandpositions93(:,2)'),'LineWidth', 2); % exp

hold on;
jmode = anormb(jmode_r,Z_fen_group_CS1_Y_saved(gg(nuu),:));
c = plot(grandpositions93(:,1), (jmode + grandpositions93(:,2)),'LineWidth', 2);


jmode03 = anormb(jmode03_r,Z_fen_group_CS1_Y_saved(gg(nuu),:));
