xlabel('spatial distance (m)');
ylabel('amplitude');
set(gca,'fontname','adobe caslon pro bold');
title({'Comparison of the Numerical and Experimental Mode Shapes','Mode 1 shape  - Y-Axis (with the peaks normalized)'});
xlim([0 1500])
L = [b;c;e];
legend(L,'Experimental Model','Numerical Model (raids hor: 1e9N/m, eta = 0.1)','Numerical Model (raids hor: 1e8N/m, eta = 0.1)', 'Location','NorthWest');
grid on;
grid minor;
